    [],nt"revision_timestamp": "2015-09-26T20:56:26.310829",nt"name": "former-soviet-union-fsu-gravity-data",nt"isopen":
    false,nt"url": null,nt"notes": "Gridded gravity anomaly data for the Former
    Soviet Union (FSU) and Eastern Europe has been received by the National Geophysical
    Data Center(NGDC). The data file contains 1 x 1 degree grid data constructed from
    several one(1) degree latitude band files. The observed gravity values are believed
    to be referenced to the International Gravity Standardization Net 1971(IGSN71) and
    the gravity anomaly is believed to have been computed using the Geodetic Reference
    System 1967(GRS67) theoretical gravity formula.",nt"license_title": null,nt"extras":
